import { useSelector } from 'react-redux';
import { Route, Routes } from 'react-router-dom';

import { Navbar, Sidebar, Footer } from './components';
import { Home, Workouts, Exercises, CreateWorkout, EditWorkout, CreateExercise, EditExercise, Login, Register } from './pages';

const App = () => {
  const { isAuthenticated } = useSelector((state) => state.auth);

  return (
    <div>
      <Navbar />

      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <Sidebar />
          </div>
          <div className="col-md-9">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/workouts" element={<Workouts />} />
              <Route
                path="/workouts/new"
                element={isAuthenticated ? <CreateWorkout /> : <Navigate to="/login" />}
              />
              <Route
                path="/workouts/:id/edit"
                element={isAuthenticated ? <EditWorkout /> : <Navigate to="/login" />}
              />
              <Route path="/exercises" element={<Exercises />} />
              <Route
                path="/exercises/new"
                element={isAuthenticated ? <CreateExercise /> : <Navigate to="/login" />}
              />
              <Route
                path="/exercises/:id/edit"
                element={isAuthenticated ? <EditExercise /> : <Navigate to="/login" />}
              />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Routes>
          </div>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default App;
